// ===================== BASE64 IMAGES =====================
const catear1 = "data:image/png;base64,"
const catear2 = "data:image/png;base64,"; // replace with your full base64

function createfemkClientGUI() {

    const old = document.getElementById("uiverseGui");
    if (old) old.remove();

    const style = document.createElement("style");
    style.textContent = `
        #uiverseGui { 
            position: fixed; 
            padding: 1em; 
            background: #FA8FED; 
            border-radius: .8em;
            box-shadow: 4px 4px 12px #c47adf, -4px -4px 12px #ffb3f5; 
            z-index: 99999;
            display: flex; 
            flex-direction: column; 
            align-items: center; 
            justify-content: center;
            gap: 15px; 
            user-select: none; 
            font-family: Verdana, arial, helvetica, clean, sans-serif;
            color: #fff; 
        }
        #uiverseGui .header { 
            width: 100%; 
            height: 5px; 
            display: flex; 
            justify-content: flex-end;
            align-items: center; 
            cursor: move; 
            margin-bottom: 0; 
        }
        #uiverseGui .closeBtn { 
            cursor: pointer; 
            font-weight: bold; 
            font-size: 14px;
            background: transparent; 
            border: none; 
            color: #fff; 
        }
        #uiverseGui .title { 
            font-size: 18px; 
            font-weight: bold; 
            text-align: center; 
            margin-bottom: 10px;
            user-select: none; 
        }
        #uiverseGui button.uiverseBtn { 
            color: #fff; 
            padding: .5em 1.2em; 
            font-size: 16px; 
            font-weight: bold;
            border-radius: .5em; 
            background: #ff5ce6; 
            cursor: pointer; 
            border: 2px solid #ff33cc;
            transition: all .2s ease; 
            box-shadow: 4px 4px 8px #d149b3, -4px -4px 8px #ff80df;
            display: block; 
            user-select: none; 
            margin-top: 5px; 
            text-align: center; 
        }
        #uiverseGui button.uiverseBtn:hover { 
            background: #ff33cc; 
            box-shadow: 2px 2px 6px #d149b3, -2px -2px 6px #ff80df;
        }
        #uiverseGui button.uiverseBtn:active { 
            box-shadow: inset 2px 2px 6px #d149b3, inset -2px -2px 6px #ff80df; 
        }
        .ear-image {
            position: absolute;
            pointer-events: none; /* so GUI drag works without interference */
        }
    `;
    document.head.appendChild(style);

    // ===================== GUI =====================
    const gui = document.createElement("div");
    gui.id = "uiverseGui";

    const header = document.createElement("div");
    header.className = "header";
    const close = document.createElement("button");
    close.className = "closeBtn";
    close.textContent = "";
    close.onclick = () => gui.remove();
    header.appendChild(close);
    gui.appendChild(header);

    const title = document.createElement("div");
    title.className = "title";
    title.textContent = "Fem Client";
    gui.appendChild(title);

    const toggleBtn = document.createElement("button");
    toggleBtn.className = "uiverseBtn";
    let autoOn = false;
    toggleBtn.textContent = "Toggle Mode: OFF";
    toggleBtn.onclick = () => {
        autoOn = !autoOn;
        toggleBtn.textContent = autoOn ? "Toggle Mode: ON" : "Toggle Mode: OFF";
    };
    gui.appendChild(toggleBtn);

    const getAnswerBtn = document.createElement("button");
    getAnswerBtn.className = "uiverseBtn";
    getAnswerBtn.textContent = "Get Answer";
    getAnswerBtn.onclick = () => console.log("Answer requested!");
    gui.appendChild(getAnswerBtn);

    document.body.appendChild(gui);

    // Center GUI
    const rect = gui.getBoundingClientRect();
    gui.style.left = (window.innerWidth - rect.width) / 2 + "px";
    gui.style.top  = (window.innerHeight - rect.height) / 2 + "px";

    // ================== GUI DRAG ==================
    let dragGui = false, offX = 0, offY = 0;
    gui.addEventListener("mousedown", e => {
        if (!e.target.closest("button")) {
            dragGui = true;
            offX = e.clientX - gui.getBoundingClientRect().left;
            offY = e.clientY - gui.getBoundingClientRect().top;
        }
    });
    document.addEventListener("mousemove", e => {
        if (dragGui) {
            gui.style.left = e.clientX - offX + "px";
            gui.style.top  = e.clientY - offY + "px";
        }
    });
    document.addEventListener("mouseup", () => dragGui = false);

    // ===================== EARS =====================
// ===================== EARS =====================
const earData = [
    { src: catear1, x: 315, y: 234, width: 99, height: 99 },
    { src: catear2, x: 523, y: 200, width: 115, height: 115 }
];

// Get GUI top-left position
const guiRect = gui.getBoundingClientRect();

earData.forEach(data => {
    const img = document.createElement("img");
    img.src = data.src;
    img.className = "ear-image";
    // Make position relative to GUI
    img.style.left = (data.x - guiRect.left) + "px";
    img.style.top  = (data.y - guiRect.top) + "px";
    img.style.width = data.width + "px";
    img.style.height = data.height + "px";
    gui.appendChild(img);
});

}
// Initialize
createfemkClientGUI();
